import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [products, setProducts] = useState([]);

  // Fetch products from the backend (Express API)
  useEffect(() => {
    axios.get('http://localhost:3005/products')  // Replace with your backend URL
      .then((response) => {
        setProducts(response.data);  // Store the response data (products)
      })
      .catch((error) => {
        console.error('There was an error fetching the products:', error);
      });
  }, []);  // Empty dependency array to run this once when the component mounts

  return (
    <div className="App">
      <h1>Products</h1>
      <ul>
        {products.map((product) => (
          <li key={product.id}>
            {product.name} - ${product.price}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
